import React from 'react';
import styles from './Detailcss.module.css' 
import TodoInsert from './TodoInsert';

const Todo =({children})=>{
    

    return(
        <div className={`${styles.Todotemplate} `}>
            Template
            <div className={`${styles.titlen}` }> 
                Today-List
            </div>
            
            <div className={`${styles.content},`}>
                this is not main
                {children}
            </div>
            
    
        </div>
    );
}

export default Todo;
